(58, '{\"ar\":{\"title\":\"\\u062a\\u062c\\u0631\\u064a\\u0628 - \\u0631\\u0643\\u0648\\u0628 \\u0627\\u0644\\u062f\\u0631\\u0627\\u062c\\u0627\\u062a \\u0627\\u0644\\u0633\\u0631\\u064a\\u0639\\u0629\"},\"en\":{\"title\":\"Workout  - Fast Cycling\"},\"ch\":{\"title\":\"\\u904b\\u52d5 - \\u5feb\\u901f\\u9a0e\\u81ea\\u884c\\u8eca\"}}', '{\"ar\":{\"description\":\"<pre>\\r\\n\\u0645\\u0645\\u0627\\u0631\\u0633\\u0629 \\u0627\\u0644\\u0631\\u064a\\u0627\\u0636\\u0629 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u062f\\u0631\\u0627\\u062c\\u0629 \\u0644\\u0645\\u062f\\u0629 30 \\u062f\\u0642\\u064a\\u0642\\u0629 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0623\\u0642\\u0644 \\u064a\\u0648\\u0645\\u064a\\u064b\\u0627 \\u0633\\u062a\\u0639\\u0632\\u0632 \\u0645\\u0646 \\u0642\\u062f\\u0631\\u0629 \\u0627\\u0644\\u0642\\u0644\\u0628 \\u0648\\u0627\\u0644\\u0623\\u0648\\u0639\\u064a\\u0629 \\u0627\\u0644\\u062f\\u0645\\u0648\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0639\\u0636\\u0644\\u0627\\u062a \\u0639\\u0644\\u0649 \\u0627\\u0644\\u062a\\u062d\\u0645\\u0644. \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0628\\u0630\\u0644 \\u062c\\u0647\\u062f \\u0645\\u062a\\u0648\\u0627\\u0635\\u0644\\u060c \\u0633\\u062a\\u0644\\u0627\\u062d\\u0638 \\u062a\\u062d\\u0633\\u0646\\u064b\\u0627 \\u0641\\u064a \\u0642\\u062f\\u0631\\u062a\\u0643 \\u0627\\u0644\\u0647\\u0648\\u0627\\u0626\\u064a\\u0629\\u060c \\u0645\\u0645\\u0627 \\u064a\\u062a\\u064a\\u062d \\u0644\\u0643 \\u0631\\u0643\\u0648\\u0628 \\u0627\\u0644\\u062f\\u0631\\u0627\\u062c\\u0629 \\u0644\\u0641\\u062a\\u0631\\u0629 \\u0623\\u0637\\u0648\\u0644 \\u0623\\u0648 \\u0641\\u064a \\u062c\\u0648\\u0644\\u0627\\u062a \\u0623\\u0643\\u062b\\u0631 \\u0643\\u062b\\u0627\\u0641\\u0629.<\\/pre>\"},\"en\":{\"description\":\"<p>Exercising on the bike for at least 30 minutes a day will <strong>build up your cardiovascular and muscular endurance<\\/strong>. By putting in consistent effort, you&#39;ll notice an improvement in your aerobic capacity, e