(56, '{\"ar\":{\"title\":\"\\u062a\\u062c\\u0631\\u064a\\u0628 - \\u0627\\u0644\\u062c\\u0631\\u064a \\u0627\\u0644\\u0628\\u0637\\u064a\\u0621\"},\"en\":{\"title\":\"Workout - Slow Running\"},\"ch\":{\"title\":\"\\u935b\\u934a - \\u6162\\u8dd1\"}}', '{\"ar\":{\"description\":\"<pre>\\r\\n\\u0647\\u0646\\u0627\\u0643 \\u0638\\u0627\\u0647\\u0631\\u0629 \\u062c\\u0631\\u064a \\u0635\\u063a\\u064a\\u0631\\u0629 \\u0623\\u062d\\u0628 \\u0623\\u0646 \\u0623\\u0633\\u0645\\u064a\\u0647\\u0627 &quot;\\u0627\\u0644\\u062c\\u0631\\u064a \\u0628\\u0633\\u0631\\u0639\\u0629 \\u0648\\u0627\\u062d\\u062f\\u0629&quot;\\u060c \\u062d\\u064a\\u062b \\u064a\\u0642\\u0648\\u0645 \\u0627\\u0644\\u0639\\u062f\\u0627\\u0621 \\u0628\\u062a\\u0633\\u062c\\u064a\\u0644 \\u062c\\u0645\\u064a\\u0639 \\u0627\\u0644\\u0623\\u0645\\u064a\\u0627\\u0644 \\u0627\\u0644\\u062a\\u064a \\u0642\\u0637\\u0639\\u0647\\u0627 \\u062a\\u0642\\u0631\\u064a\\u0628\\u064b\\u0627 \\u0628\\u0646\\u0641\\u0633 \\u0627\\u0644\\u062c\\u0647\\u062f. \\u064a\\u0648\\u0645 \\u0628\\u0639\\u062f \\u064a\\u0648\\u0645. \\u062a\\u0628\\u0644\\u063a \\u0647\\u0630\\u0647 \\u0627\\u0644\\u0633\\u0631\\u0639\\u0629 \\u0639\\u0627\\u062f\\u0629\\u064b \\u062d\\u0648\\u0627\\u0644\\u064a 75 \\u0628\\u0627\\u0644\\u0645\\u0627\\u0626\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u062d\\u062f \\u0627\\u0644\\u0623\\u0642\\u0635\\u0649 \\u0644\\u0644\\u062c\\u0647\\u062f - \\u0648\\u0647\\u064a \\u0644\\u064a\\u0633\\u062a \\u0628\\u0627\\u0644\\u0633\\u0631\\u0639\\u0629 \\u0627\\u0644\\u0643\\u0627\\u0641\\u064a\\u0629 \\u0644\\u062c\\u0639\\u0644 \\u062c\\u0633\\u0645\\u0643 \\u064a\\u0639\\u0645\\u0644 \\u0628\\u062c\\u062f \\u0648\\u064a\\u062a\\u0643\\u064a\\u0641\\u060c \\u0648\\u0644\\u0643\\u0646\\u0647\\u0627 \\u0633\\u0631\\u064a\\u0639\\u0629 \\u062c\\u062f\\u064b\\u0627 \\u0628\\u062d\\u064a\\u062b \\u0644\\u0627 \\u062a\\u062a\\u0645\\u0643\\u0646 \\u0645\\u0646 \\u0628\\u0646\\u0627\\u0621 \\u0642\\u062f\\u0631 \\u0643\\u0628\\u064a\\u0631 \\u0645\\u0646 \\u0627\\u0644\\u0642\\u062f\\u0631\\u0629 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u062a\\u062d\\u0645\\u0644 \\u0623\\u0648 \\u0627\\u0639\\u062a\\u0628\\u0627\\u0631\\u0647\\u0627 \\u0628\\u0645\\u062b\\u0627\\u0628\\u0629 \\u062c\\u0631\\u064a &quot;\\u0644\\u0644\\u062a\\u0639\\u0627\\u0641\\u064a&quot;.<\\/pre>\"},\"en\":{\"description\":\"<p>There&rsquo;s a little running phenomenon I like to call &ldquo;Single Speed Running,&rdquo; where a runner logs nearly all of his or her miles at the exact same effort. Day after day. That speed is usually around 75 percent of max effort &mdash; not fast enough to really make your body work hard and adapt, but too fast to build much endurance or count as a &ldquo;recovery&rdquo; run.<\\/p>\"},\"ch\":{\"description\":\"<pre>\\r\\n\\u6709\\u4e00\\u7a2e\\u8dd1\\u6b65\\u73fe\\u8c61\\uff0c\\u6211\\u559c\\u6b61\\u7a31\\u4e4b\\u70ba&ldquo;\\u55ae\\u901f\\u8dd1\\u6b65&rdquo;\\uff0c\\u5373\\u8dd1\\u6b65\\u8005\\u4ee5\\u5b8c\\u5168\\u76f8\\u540c\\u7684\\u52aa\\u529b\\u8dd1\\u5b8c\\u5e7e\\u4e4e\\u6240\\u6709\\u91cc\\u7a0b\\u3002\\u65e5\\u5fa9\\u4e00\\u65e5\\u3002\\u9019\\u500b\\u901f\\u5ea6\\u901a\\u5e38\\u662f\\u6700\\u5927\\u52aa\\u529b\\u7684 75% \\u5de6\\u53f3&mdash;&mdash;\\u4e0d\\u5920\\u5feb\\uff0c\\u4e0d\\u8db3\\u4ee5\\u8b93\\u4f60\\u7684\\u8eab\\u9ad4\\u771f\\u6b63\\u52aa\\u529b\\u5de5\\u4f5c\\u548c\\u9069\\u61c9\\uff0c\\u4f46\\u592a\\u5feb\\u4e86\\uff0c\\u7121\\u6cd5\\u5efa\\u7acb\\u8db3\\u5920\\u7684\\u8010\\u529b\\u6216\\u7b97\\u4f5c\\u300c\\u6062\\u5fa9\\u300d\\u8dd1\\u6b65\\u3002<\\/pre>\"}}', '1716961988_file.mp4', '1716961992_thumbnail_image.jpg', '10', 'video', NULL, 0, 0.00, '[\"1\",\"3\"]', '[\"69\"]', '[\"71\"]', 67, 1, '1', 'Super Admin', 'admin', 0, '2024-05-29 15:23:12', '2024-06-26 16:42:52'),
