(63, '{\"ar\":{\"title\":\"\\u062a\\u0645\\u0631\\u064a\\u0646 \\u062a\\u0636\\u062e\\u0645 \\u0627\\u0644\\u0637\\u0627\\u0642\\u0629 \\u0627\\u0644\\u0639\\u0644\\u0648\\u064a \\u0648\\u0627\\u0644\\u0633\\u0641\\u0644\\u064a (P.H.U.L.).\"},\"en\":{\"title\":\"Power Hypertrophy Upper Lower (P.H.U.L.) Workout\"},\"ch\":{\"title\":\"\\u529b\\u91cf\\u80a5\\u5927\\u4e0a\\u90e8\\u4e0b\\u90e8 (P.H.U.L.) \\u953b\\u70bc\"}}', '{\"ar\":{\"description\":\"<p>\\u0628\\u0634\\u0643\\u0644 \\u0639\\u0627\\u0645\\u060c \\u0643\\u0627\\u0646 \\u0645\\u0639\\u0638\\u0645 \\u0627\\u0644\\u0645\\u0628\\u062a\\u062f\\u0626\\u064a\\u0646 \\u064a\\u0631\\u0641\\u0639\\u0648\\u0646 \\u0627\\u0644\\u0623\\u062b\\u0642\\u0627\\u0644 \\u0644\\u0645\\u062f\\u0629 \\u062a\\u0642\\u0644 \\u0639\\u0646 \\u0639\\u0627\\u0645\\u060c \\u0648\\u0627\\u0644\\u0645\\u062a\\u0648\\u0633\\u0637\\u0648\\u0646 \\u0644\\u0645\\u062f\\u0629 \\u0639\\u0627\\u0645 \\u0648\\u0627\\u062d\\u062f \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0623\\u0642\\u0644\\u060c \\u0648\\u0627\\u0644\\u0645\\u062a\\u062f\\u0631\\u0628\\u0648\\u0646 \\u0627\\u0644\\u0645\\u062a\\u0642\\u062f\\u0645\\u0648\\u0646 \\u0644\\u0645\\u062f\\u0629 \\u0639\\u0627\\u0645\\u064a\\u0646 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0623\\u0642\\u0644. \\u0636\\u0639 \\u0641\\u064a \\u0627\\u0639\\u062a\\u0628\\u0627\\u0631\\u0643 \\u0623\\u0646\\u0647 \\u0644\\u0627 \\u064a\\u0646\\u0628\\u063a\\u064a \\u0639\\u0644\\u064a\\u0643 \\u062a\\u062c\\u0631\\u0628\\u0629 \\u0627\\u0644\\u062a\\u062f\\u0631\\u064a\\u0628\\u0627\\u062a \\u0627\\u0644\\u0645\\u062a\\u0642\\u062f\\u0645\\u0629 \\u0625\\u0644\\u0627 \\u0625\\u0630\\u0627 \\u0643\\u0627\\u0646\\u062a \\u0644\\u062f\\u064a\\u0643 \\u062e\\u0628\\u0631\\u0629 \\u0645\\u0646\\u0627\\u0633\\u0628\\u0629 \\u0641\\u064a \\u062a\\u062f\\u0631\\u064a\\u0628 \\u0627\\u0644\\u0642\\u0648\\u0629.<\\/p>\\r\\n\\r\\n<p>\\u062a\\u0633\\u062a\\u0639\\u0631\\u0636 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u0645\\