(72, '{\"ar\":{\"title\":\"Natus dolorum sit a\"},\"en\":{\"title\":\"Irure et dolor sed v\"},\"ch\":{\"title\":\"Fugiat quia consequa\"}}', '{\"ar\":{\"description\":\"<h2><a href=\\\"https:\\/\\/loremipsum.io\\/#origins-and-discovery\\\">Origins and Discovery<\\/a><\\/h2>\\r\\n\\r\\n<p><em>Lorem ipsum<\\/em>&nbsp;began as scrambled, nonsensical Latin derived from Cicero&#39;s 1st-century BC text&nbsp;<em>De Finibus Bonorum et Malorum<\\/em>.<\\/p>\\r\\n\\r\\n<p><img alt=\\\"Engraving of Marcus Tullius Cicero\\\" src=\\\"https:\\/\\/loremipsum.io\\/assets\\/images\\/lorem-ipsum-generator-cicero-engraving.png\\\" \\/><\\/p>\\r\\n\\r\\n<p>CICERO<\\/p>\\r\\n\\r\\n<h3>HEDONIST ROOTS<\\/h3>\\r\\n\\r\\n<p>Until recently, the prevailing view assumed&nbsp;<em>lorem ipsum<\\/em>&nbsp;was born as a nonsense text. &ldquo;It&#39;s not Latin, though it looks like it, and it actually says nothing,&rdquo;&nbsp;<em>Before &amp; After<\\/em>&nbsp;magazine&nbsp;<a href=\\\"https:\\/\\/www.straightdope.com\\/columns\\/read\\/2290\\/what-does-the-filler-text-lorem-ipsum-mean\\/\\\" target=\\\"_blank\\\">answered a curious reader<\\/a>, &ldquo;Its &lsquo;words&rsquo; loosely approximate the frequency with which letters occur in English, which is why at a glance it looks pretty real.&rdquo;<\\/p>\\r\\n\\r\\n<p>As Cicero would put it, &ldquo;Um, not so fast.&rdquo;<\\/p>\\r\\n\\r\\n<p>The placeholder text, beginning with the line&nbsp;<em>&ldquo;Lorem ipsum dolor sit amet, consectetur adipiscing elit&rdquo;<\\/em>, looks like Latin because in its youth, centuries ago, it was Latin.<\\/p>\\r\\n\\r\\n<p>Richard McClintock, a Latin scholar from Hampden-Sydney College, is&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Lorem_ipsum\\\" target=\\\"_blank\\\">credited<\\/a>&nbsp;with discovering the source behind the ubiquitous filler text. In seeing a sample of&nbsp;<em>lorem ipsum<\\/em>, his interest was piqued by&nbsp;<em>consectetur<\\/em>&mdash;a genuine, albeit rare, Latin word. Consulting a Latin dictionary led McClintock to a passage from&nbsp;<em>De Finibus Bonorum et Malorum<\\/em>&nbsp;(&ldquo;On the Extremes of Good and Evil&rdquo;), a first-century B.C. text from the Roman philosopher Cicero.<\\/p>\\r\\n\\r\\n<p>In particular, the garbled words of&nbsp;<em>lorem ipsum<\\/em>&nbsp;bear an unmistakable resemblance to sections 1.10.32&ndash;33 of Cicero&#39;s work, with the most notable passage excerpted below:<\\/p>\\r\\n\\r\\n<blockquote>&ldquo;Neque porro quisquam est, qui&nbsp;<em>dolorem ipsum<\\/em>&nbsp;quia&nbsp;<em>dolor sit amet, consectetur, adipisci velit, sed<\\/em>&nbsp;quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem.&rdquo;<\\/blockquote>\\r\\n\\r\\n<p>A 1914 English translation by&nbsp;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Lorem_ipsum#English_translation\\\" target=\\\"_blank\\\">Harris Rackham<\\/a>&nbsp;reads:<\\/p>\\r\\n\\r\\n<blockquote>&ldquo;Nor is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but occasionally circumstances occur in which toil and pain can procure him some great pleasure.&rdquo;<\\/blockquote>\\r\\n\\r\\n<p>McClintock&#39;s eye for detail certainly helped narrow the whereabouts of&nbsp;<em>lorem ipsum&#39;s<\\/em>&nbsp;origin, however, the &ldquo;how and when&rdquo; still remain something of a mystery, with competing theories and timelines.<\\/p>\\r\\n\\r\\n<h2><a href=\\\"https:\\/\\/loremipsum.io\\/#fuzzy-beginnings\\\">Fuzzy Beginnings<\\/a><\\/h2>\\r\\n\\r\\n<p>Creation timelines for the standard&nbsp;<em>lorem ipsum<\\/em>&nbsp;passage vary, with some citing the 15th century and others the 20th.<\\/p>\\r\\n\\r\\n<p><img alt=\\\"Typesetter selecting type for a galley\\\" src=\\\"https:\\/\\/loremipsum.io\\/assets\\/images\\/lorem-ipsum-15th-century-typesetter.jpg\\\" \\/><\\/p>\\r\\n\\r\\n<p>TYPESETTER SELECTING TYPE<\\/p>\\r\\n\\r\\n<h3>REMIXING A CLASSIC<\\/h3>\\r\\n\\r\\n<p>So how did the classical Latin become so incoherent? According to McClintock, a 15th century typesetter likely scrambled part of Cicero&#39;s&nbsp;<em>De Finibus<\\/em>&nbsp;in order to provide placeholder text to mockup various fonts for a type specimen book.<\\/p>\\r\\n\\r\\n<p>It&#39;s difficult to find examples of&nbsp;<em>lorem ipsum<\\/em>&nbsp;in use before Letraset made it popular as a dummy text in the 1960s, although McClintock says he remembers coming across the&nbsp;<em>lorem ipsum<\\/em>&nbsp;passage in a book of old metal type samples. So far he hasn&#39;t relocated where he once saw the passage, but the popularity of Cicero in the 15th century supports the theory that the filler text has been used for centuries.<\\/p>\\r\\n\\r\\n<p>And anyways, as&nbsp;<a href=\\\"https:\\/\\/www.straightdope.com\\/columns\\/read\\/2290\\/what-does-the-filler-text-lorem-ipsum-mean\\/\\\" target=\\\"_blank\\\">Cecil Adams reasoned<\\/a>, &ldquo;[Do you really] think graphic arts supply houses were hiring classics scholars in the 1960s?&rdquo; Perhaps. But it seems reasonable to imagine that there was a version in use far before the age of Letraset.<\\/p>\\r\\n\\r\\n<p>McClintock&nbsp;<a href=\\\"http:\\/\\/www.loremipsum.de\\/about_lorem_ipsum.html\\\" target=\\\"_blank\\\">wrote<\\/a>&nbsp;to&nbsp;<em>Before &amp; After<\\/em>&nbsp;to explain his discovery;<\\/p>\\r\\n\\r\\n<blockquote>&ldquo;What I find remarkable is that this text has been the industry&#39;s standard dummy text ever since some printer in the 1500s took a galley of type and scrambled it to make a type specimen book; it has survived not only four centuries of letter-by-letter resetting but even the leap into electronic typesetting, essentially unchanged except for an occasional &#39;ing&#39; or &#39;y&#39; thrown in. It&#39;s ironic that when the then-understood Latin was scrambled, it became as incomprehensible as Greek; the phrase &#39;it&#39;s Greek to me&#39; and &#39;<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Greeking\\\" target=\\\"_blank\\\">greeking<\\/a>&#39; have common semantic roots!&rdquo; (The editors published his letter in a correction headlined &ldquo;Lorem Oopsum&rdquo;).<\\/blockquote>\\r\\n\\r\\n<p>As an&nbsp;<a href=\\\"https:\\/\\/www.deepadvantage.com\\/blog\\/lorem-ipsum\\/\\\" target=\\\"_blank\\\">alternative theory<\\/a>, (and because Latin scholars do this sort of thing) someone tracked down a 1914 Latin edition of&nbsp;<em>De Finibus<\\/em>&nbsp;which challenges McClintock&#39;s 15th century claims and suggests that the dawn of&nbsp;<em>lorem ipsum<\\/em>&nbsp;was as recent as the 20th century. The 1914 Loeb Classical Library Edition ran out of room on page 34 for the Latin phrase &ldquo;dolorem ipsum&rdquo; (sorrow in itself). Thus, the truncated phrase leaves one page dangling with &ldquo;do-&rdquo;, while another begins with the now ubiquitous &ldquo;lorem ipsum&rdquo;.<\\/p>\\r\\n\\r\\n<p>Whether a medieval typesetter chose to garble a well-known (but non-Biblical&mdash;that would have been sacrilegious) text, or whether a quirk in the 1914 Loeb Edition inspired a graphic designer, it&#39;s admittedly an odd way for Cicero to sail into the 21st century.<\\/p>\\r\\n\\r\\n<h2><a href=\\\"https:\\/\\/loremipsum.io\\/#meaning\\\">Meaning of Lorem Ipsum<\\/a><\\/h2>\\r\\n\\r\\n<p><em>Lorem ipsum<\\/em>&nbsp;was purposefully designed to have no meaning, but appear like real text, making it the perfect placeholder.<\\/p>\\r\\n\\r\\n<p><img alt=\\\"Letraset Transfer Sheets with Lorem Ipsum\\\" src=\\\"https:\\/\\/loremipsum.io\\/assets\\/images\\/lorem-ipsum-generator-letraset-transfer-sheet.png\\\" \\/><\\/p>\\r\\n\\r\\n<p>LETRASET TRANSFER SHEETS<\\/p>\\r\\n\\r\\n<h3>INTERPRETING NONSENSE<\\/h3>\"},\"en\":{\"description\":\"<h2><a href=\\\"https:\\/\\/loremipsum.io\\/#origins-and-discovery\\\">Origins and Discovery<\\/a><\\/h2>\\r\\n\\r\\n<p><em>Lorem ipsum<\\/em>&nbsp;began as scrambled, nonsensical Latin derived from Cicero&#39;s 1st-centu