(28, 'Michael', 'sub1', 'admin', 'admin@admin.com', NULL, '$2y$12$clWpKxKscXaSgC/fIxHbJ.DQpzZz9.uaN.WV3UW1hEhio5JMjYlMS', NULL, '2024-01-12 06:19:15', '2024-02-29 10:50:04', 1, '1709185804_profile_image.png', '789456123', 'Male', NULL, 99, NULL, NULL, '0', 'Senior Yoga Trainer', 1, NULL, 0, 0, 0, 'yoga trainner', 'As a writer, I have to let readers and potential clients know my expertise, my skills, and why they should work with me or be interested in what I say. So, a professional bio is a must in my industry.', '[{\"value\":\"yoga\"},{\"value\":\"fitness\"}]', 1, NULL, '0', NULL, '0', NULL, '0', NULL, 0),
(44, 'ketan 01', 'Role Name', 'Role Name', 'ketan49@mailinater.com', NULL, '$2y$12$clWpKxKscXaSgC/fIxHbJ.DQpzZz9.uaN.WV3UW1hEhio5JMjYlMS', NULL, '2024-01-17 07:08:36', '2024-02-29 10:49:51', 1, '1709185781_profile_image.png', '7412589630', 'Male', 'VGR784', 99, NULL, NULL, '0', 'Senior Yoga Trainer', 1, NULL, 10, 0, 0, 'Senior Yoga Teacher', 'Hello and I would like to welcome you to my yoga classes! My name is ketan and Im a yoga certified instructor who is passionate about promoting well being and mindfulness with the practice of yoga. Experienced for years and a profound understanding of the connection between mind and body I aim to create a safe and supportive atmosphere for my students as they discover the yoga path. In this biography, Ill discuss my background, experience and my teaching philosophy.', '[{\"value\":\"Meditation\"}]', 1, NULL, '0', NULL, '0', NULL, '0', NULL, 0),
(41, 'Oliver', 'first name', 'last name', 'ketan09@gmail.com', NULL, '$2y$12$LJ.b0YH7Tk4.YXZ7PqHY.eiyMRVljCMPYQx/16s8Z3lpo2RalHdBO', NULL, '2024-01-17 06:52:53', '2024-04-01 17:18:13', 1, '1709185761_profile_image.png', '7412589630', 'Male', 'CBR784', 99, 'eTZ-B6ihTsq4nzBOX7t7zZ:APA91bHJAU-mFRaHW6JQEV-fVE03BMDrhkH6vXOXjFsPxQhRQPiMs741d0_WXhgK56VQe1z6-XNJ589qZ0ZIti16QrgI5z1v5t7jSmtydAX1XDa4cbmgbOtVIit-Nnm-p5DL3QRqFfAq', 'android', '0', 'junior Yoga Trainer', 1, NULL, 0, 0, 0, 'Yoga Teacher', 'I have been teaching yoga since 2009. My first classes were for my coworkers on the top of a hill overlooking downtown Portland. This only lasted until the winter rain arrived in late October. After that I taught at several studios around Portland. I now live in a small village outside of Owen Sound, Ontario, where I teach meditation-focused, chair, and other yoga classes.\r\n\r\nMy yoga teaching is rooted in the breath-based viniyoga style of T. K. V. Desikachar, but also draws on other types of yoga, including ashtanga, power vinyasa, and shadow yoga. I encourage students to move at their own pace and work slowly toward more challenging yoga poses. I also have a long-time Buddhist meditation practice, so I regularly include breathing exercises (aka pranayama) and meditation in my classes.\r\n\r\nWhen Im not writing or teaching yoga, you can often find me cross-country skiing or hiking in the forest or mountains. These are the same kinds of peaceful places where I once gathered pine needles as a child. Sadly, I dont know what happened to my pine needle collection, but I did recently find a sealed jar of margarine that I had stashed in a closet in my childhood home.', '[{\"value\":\"Meditation\"},{\"value\":\"Anatomy\"},{\"value\":\"Asana\"},{\"value\":\"Pilates\"},{\"value\":\"Front Desk\"},{\"value\":\"Hatha Yoga\"}]', 1, NULL, '0', NULL, '0', NULL, '0', NULL, 0),
